import logo from './logo.svg';
import './App.css';
import Task from "./components/Task";
import { Center, Box, CheckboxGroup, Text } from "@chakra-ui/react";

const tasks = [
  { id: 1, content: "買い物"},
  { id: 2, content: "ランニング"},
  { id: 3, content: "プログラミング学習"},
]
function App() {
  return (
    <Box mt="64px">
      <Center>
        <Box>
          <Box mb="24px">
            <Text fontsize="24px">
              タスク一覧
            </Text>
          </Box>
        </Box>
        <CheckboxGroup>

        </CheckboxGroup>
      </Center>
      <div>
        {tasks.map(task => {
          return (
              <Task name={task.content}/>
          )
        })}
      </div>
    </Box>
  );
}

export default App;
